  x = I128(0, 0);
  y = I128(0, 0);
  ASSERT128(I128(0, 0), x + y);
  x = I128(0, 0);
  y = I128(0, 2);
  ASSERT128(I128(0, 2), x + y);
  x = I128(0, 0);
  y = I128(0, BANE);
  ASSERT128(I128(0, BANE), x + y);
  x = I128(0, 0);
  y = I128(0, -1ul);
  ASSERT128(I128(0, -1ul), x + y);
  x = I128(0, 0);
  y = I128(2, 0);
  ASSERT128(I128(2, 0), x + y);
  x = I128(0, 0);
  y = I128(2, 2);
  ASSERT128(I128(2, 2), x + y);
  x = I128(0, 0);
  y = I128(2, BANE);
  ASSERT128(I128(2, BANE), x + y);
  x = I128(0, 0);
  y = I128(2, -1ul);
  ASSERT128(I128(2, -1ul), x + y);
  x = I128(0, 0);
  y = I128(BANE, 0);
  ASSERT128(I128(BANE, 0), x + y);
  x = I128(0, 0);
  y = I128(BANE, 2);
  ASSERT128(I128(BANE, 2), x + y);
  x = I128(0, 0);
  y = I128(BANE, BANE);
  ASSERT128(I128(BANE, BANE), x + y);
  x = I128(0, 0);
  y = I128(BANE, -1ul);
  ASSERT128(I128(BANE, -1ul), x + y);
  x = I128(0, 0);
  y = I128(-1ul, 0);
  ASSERT128(I128(-1ul, 0), x + y);
  x = I128(0, 0);
  y = I128(-1ul, 2);
  ASSERT128(I128(-1ul, 2), x + y);
  x = I128(0, 0);
  y = I128(-1ul, BANE);
  ASSERT128(I128(-1ul, BANE), x + y);
  x = I128(0, 0);
  y = I128(-1ul, -1ul);
  ASSERT128(I128(-1ul, -1ul), x + y);
  x = I128(0, 2);
  y = I128(0, 0);
  ASSERT128(I128(0, 2), x + y);
  x = I128(0, 2);
  y = I128(0, 2);
  ASSERT128(I128(0, 4), x + y);
  x = I128(0, 2);
  y = I128(0, BANE);
  ASSERT128(I128(0, BANE2), x + y);
  x = I128(0, 2);
  y = I128(0, -1ul);
  ASSERT128(I128(1, 1), x + y);
  x = I128(0, 2);
  y = I128(2, 0);
  ASSERT128(I128(2, 2), x + y);
  x = I128(0, 2);
  y = I128(2, 2);
  ASSERT128(I128(2, 4), x + y);
  x = I128(0, 2);
  y = I128(2, BANE);
  ASSERT128(I128(2, BANE2), x + y);
  x = I128(0, 2);
  y = I128(2, -1ul);
  ASSERT128(I128(3, 1), x + y);
  x = I128(0, 2);
  y = I128(BANE, 0);
  ASSERT128(I128(BANE, 2), x + y);
  x = I128(0, 2);
  y = I128(BANE, 2);
  ASSERT128(I128(BANE, 4), x + y);
  x = I128(0, 2);
  y = I128(BANE, BANE);
  ASSERT128(I128(BANE, BANE2), x + y);
  x = I128(0, 2);
  y = I128(BANE, -1ul);
  ASSERT128(I128(BANE1, 1), x + y);
  x = I128(0, 2);
  y = I128(-1ul, 0);
  ASSERT128(I128(-1ul, 2), x + y);
  x = I128(0, 2);
  y = I128(-1ul, 2);
  ASSERT128(I128(-1ul, 4), x + y);
  x = I128(0, 2);
  y = I128(-1ul, BANE);
  ASSERT128(I128(-1ul, BANE2), x + y);
  x = I128(0, 2);
  y = I128(-1ul, -1ul);
  ASSERT128(I128(0, 1), x + y);
  x = I128(0, BANE);
  y = I128(0, 0);
  ASSERT128(I128(0, BANE), x + y);
  x = I128(0, BANE);
  y = I128(0, 2);
  ASSERT128(I128(0, BANE2), x + y);
  x = I128(0, BANE);
  y = I128(0, BANE);
  ASSERT128(I128(1, 0), x + y);
  x = I128(0, BANE);
  y = I128(0, -1ul);
  ASSERT128(I128(1, IMAX), x + y);
  x = I128(0, BANE);
  y = I128(2, 0);
  ASSERT128(I128(2, BANE), x + y);
  x = I128(0, BANE);
  y = I128(2, 2);
